import React from 'react';

const MainContent = () => {
  return (
    <main className="flex-1 bg-gray-50 p-6 overflow-y-auto">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-2xl font-semibold text-gray-900">Home Building 101</h1>
        <p className="text-gray-500">Welcome to Home Building 101 Certification</p>
        <div className="mt-6">
          <video className="w-full h-auto rounded" controls>
            <source src="/path/to/video.mp4" type="video/mp4" /> {/* Replace with your video path */}
            Your browser does not support the video tag.
          </video>
        </div>
      </div>
    </main>
  );
};

export default MainContent;
